    height: 100vh;
    max-width: 25rem;
    width: 100%;
    background-color: #F9F6F0;

    .head {
        width: 100%;
        height: 5.625rem;
        background-color: #161616;
        text-align: right;
        padding-top: 1.4rem;

        .close {
            margin: 0 1.2rem;
        }
    }

    ul {    
        width: 100%;

        .menu {
            color: #444c54;
            padding: 1rem;
            background-color: rgba(239, 236, 230);

